import React, { useState, useEffect } from "react";

const Weather = () => {
  const [weatherData, setWeatherData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    if ("geolocation" in navigator) {
      navigator.geolocation.getCurrentPosition(
        async (position) => {
          const { latitude, longitude } = position.coords;

          try {
            const response = await fetch(
              `https://api.openweathermap.org/data/2.5/weather?lat=${latitude}&lon=${longitude}&appid=56a1ed2611bd3972271b413653c7bb8d`
            );

            if (!response.ok) {
              throw new Error("Weather data request failed");
            }

            const data = await response.json();

            if (
              !data.name ||
              !data.sys ||
              !data.weather ||
              !data.main ||
              !data.wind
            ) {
              throw new Error("Weather data structure is incomplete");
            }

            setWeatherData(data);
            setLoading(false);
          } catch (error) {
            console.error("Error fetching or processing weather data:", error);
            setError("Failed to fetch weather data.");
            setLoading(false);
          }
        },
        (error) => {
          console.error("Error getting geolocation:", error);
          setError("Failed to retrieve geolocation.");
          setLoading(false);
        }
      );
    } else {
      console.error("Geolocation is not available in this browser.");
      setError("Geolocation is not supported in your browser.");
      setLoading(false);
    }
  }, []);

  return (
    <div className="  min-h-screen flex items-center justify-center relative">
      <video
        autoPlay
        loop
        muted
        className="absolute opacity-50 top-0 left-0 w-full h-full object-cover "
      >
        <source src="/background-video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      <div className="bg-gray-600 p-6 rounded-lg shadow-lg text-center">
        <h1 className="text-3xl md:text-4xl lg:text-5xl font-semibold text-gray-800 mb-4">
          Weather Information
        </h1>
        {loading ? (
          <p className="text-gray-600 text-lg">Loading weather data...</p>
        ) : error ? (
          <p className="text-red-500 text-lg">{error}</p>
        ) : weatherData ? (
          <div>
            <h2 className="text-2xl font-semibold text-gray-800 mb-2">
              {weatherData.name}, {weatherData.sys.country}
            </h2>
            <p className="text-gray-600 text-lg mb-2">
              Weather: {weatherData.weather[0].description}
            </p>
            <p className="text-gray-600 text-lg mb-2">
              Temperature: {weatherData.main.temp}K
            </p>
            <p className="text-gray-600 text-lg mb-2">
              Humidity: {weatherData.main.humidity}%
              <svg
                xmlns="http://www.w3.org/2000/svg"
                className="h-6 w-6 inline-block ml-1"
                viewBox="0 0 20 20"
                fill="currentColor"
              >
                <path
                  fillRule="evenodd"
                  d="M12.356 2.957a7.01 7.01 0 0 1 5.604 5.605c.696 2.59-.7 5.337-3.326 8.218a29.04 29.04 0 0 1-3.434 3.005 1 1 0 0 1-1.227 0 28.99 28.99 0 0 1-3.434-3.004C2.738 13.9 1.342 11.152 2.038 8.562a7.01 7.01 0 0 1 5.604-5.605 6.993 6.993 0 0 1 7.126 5.71 1 1 0 0 1-1 1.114h-.148a5.99 5.99 0 0 0-1.666-.323 6.003 6.003 0 0 0-2.663.635c-.822.428-1.548 1.013-2.097 1.736a1 1 0 0 1-1.414-1.414c.602-.603 1.296-1.074 2.08-1.399a7.026 7.026 0 0 1 5.473-.024c.783.324 1.475.795 2.078 1.399a1 1 0 0 1-1.414 1.414c-.552-.723-1.278-1.308-2.1-1.737a6.005 6.005 0 0 0-2.663-.635 5.99 5.99 0 0 0-1.666.322h-.147a1 1 0 0 1-1-1.114 6.993 6.993 0 0 1 7.126-5.71zm-1.48 7.042a1 1 0 0 1-1.414 0l-1.682-1.682a1 1 0 1 1 1.414-1.414l1.24 1.24 3.799-3.8a1 1 0 0 1 1.415 1.414l-4.5 4.5z"
                  clipRule="evenodd"
                />
              </svg>
            </p>
            <p className="text-gray-600 text-lg mb-2">
              Wind Speed: {weatherData.wind.speed} m/s
            </p>
            <p className="text-gray-600 text-lg mb-2">
              Probability of Rain:{" "}
              {weatherData.rain ? weatherData.rain["1h"] || 0 : 0} mm/hr
            </p>
            <p className="text-gray-600 text-lg mb-2">
              Probability of Storm:{" "}
              {weatherData.weather[0].main === "Thunderstorm" ? "Yes" : "No"}
            </p>
          </div>
        ) : (
          <p className="text-red-500 text-lg">Failed to fetch weather data.</p>
        )}
      </div>
    </div>
  );
};

export default Weather;
